<!DOCTYPE html>
<html lang="en">
  <head>
    <title>JupyterLite</title>
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <meta name="Description" content="WASM powered Jupyter running in the browser." />
    <link rel="manifest" href="../manifest.webmanifest" />
    <link
      id="jupyter-lite-main"
      rel="modulePreload"
      href="<%= htmlWebpackPlugin.files.js[0] %>"
    />
    <script type="module" >
      import registerComponent from "./<%= htmlWebpackPlugin.files.js[0] %>";
      registerComponent();
    </script>


  </head>

  <body>
    <H1> Example notebook below here</H1>
    <jupyter-notebook src="test.ipynb">
    </jupyter-notebook>
    <H1>And above here</H1>
    </body>
    
  </html>
